import * as THREE from 'three';
import assert from 'assert';

/**
 * Represent Vectorizer
 * @interface Controller
 * @extends {THREE.EventDispatcher}
 */
export default class Controller extends THREE.EventDispatcher {
    /**
     * @constructor
     */
    constructor() {
        super();
    }
}

import * as THREE from 'three';
import Controller from './Controller';

/**
 * This set of controls performs orbiting, dollying (zooming), and panning. It maintains
 * the "up" direction as +Y, unlike the TrackballControls. Touch on tablet and phones is
 * supported.
 * 
 * Orbit - left mouse / touch: one finger move
 * Zoom - middle mouse, or mousewheel / touch: two finger spread or squish
 * Pan - right mouse, or arrow keys / touch: three finter swipe
 * 
 * @public
 * @extends {Controller}
 * @class
 * @example
 * controls = new THREE.OrbitController( camera );
 * controls.target.z = 150;
 */
export default class OrbitController extends Controller {
    /**
     * @constructor
     * @param {Object} object - Object which need to control using event
     * @param {Object} domElement - parent which hold the object 
     * @param {Object} config - configure the controller
     */
    constructor(object, domElement, config = {}) {
        super();
        /**
         * Object which need to control using event
         * @public
         * @type {Object} 
         */
        this.object = object;
        /**
         * parent which hold the object
         * @public
         * @type {Object} 
         */
        this.domElement = (domElement !== undefined) ? domElement : document;
        /**
         * Configure controller
         * @public
         * @type {Object} 
         */
        this.config = {
            /**
             * Set to false to disable this control
             * @public
             * @type {Boolean} 
             */
            enabled: true,
            /**
             * This option actually enables dollying in and out; left as "zoom" for
             * backwards compatibility
             * @public
             * @type {Boolean} 
             */
            noZoom: false,
            /**
             * Zoom Speed
             * @public
             * @type {Number} 
             */
            zoomSpeed: 1.0,
            /**
             * Limits to how far you can dolly in
             * @public
             * @type {Number} 
             */
            minDistance: 0,
            /**
             * Limits to how far you can dolly out
             * @public
             * @type {Number} 
             */
            maxDistance: Infinity,
            /**
             * Set to true to disable this control
             * @public
             * @type {Boolean} 
             */
            noRotate: false,
            /**
             * Rotation speed
             * @public
             * @type {Number} 
             */
            rotateSpeed: 1.0,
            /**
             * Set to true to disable this control
             * @public
             * @type {Boolean} 
             */
            noPan: false,
            /**
             * Pixels moved per arrow key push
             * @public
             * @type {Number} 
             */
            keyPanSpeed: 7.0,
            /**
             * Set to true to automatically rotate around the target
             * @public
             * @type {Boolean} 
             */
            autoRotate: false,
            /**
             * 30 seconds per round when fps is 60
             * @public
             * @type {Number} 
             */
            autoRotateSpeed: 2.0,
            /**
             * How far you can orbit vertically, upper and lower limits.
             * Range is 0 to Math.PI radians.
             * @public
             * @type {Number} in radians
             */
            minPolarAngle: 0,
            /**
             * How far you can orbit vertically, upper and lower limits.
             * Range is 0 to Math.PI radians.
             * @public
             * @type {Number} in radians
             */
            maxPolarAngle: Math.PI,
            /**
             * Set to true to disable use of the keys
             * @public
             * @type {Number} in radians
             */
            noKeys: false,
            /**
             * The four arrow keys
             * @public
             * @type {Object} in radians
             */
            keys: {
                LEFT: 37,
                UP: 38,
                RIGHT: 39,
                BOTTOM: 40
            }
        }
        //Copy User input config
        Object.keys(config).forEach((key) => {
            if (this.config.hasOwnProperty(key))
                this.config[key] = config[key];
            else
                console.warn("No such configuration : " + key);
        });

        /**
         * "target" sets the location of focus, where the control orbits around
         * and where it pans with respect to.
         * @public
         * @type {THREE.Vector3} 
         */
        this.target = new THREE.Vector3();

        /**
         * Controller Object instance
         * @private
         * @type {this}
         */
        this._this = this;
        /**
         * Event per second
         * @private
         * @type {Number}
         */
        this._EPS = 0.000001;
        /**
         * Rotation starting vector
         * @private
         * @type {THREE.Vector2}
         */
        this._rotateStart = new THREE.Vector2();
        /**
         * Rotation ending vector
         * @private
         * @type {THREE.Vector2}
         */
        this._rotateEnd = new THREE.Vector2();
        /**
         * Delta to add on each rotation
         * @private
         * @type {THREE.Vector2}
         */
        this._rotateDelta = new THREE.Vector2();
        /**
         * Panning starting vector
         * @private
         * @type {THREE.Vector2}
         */
        this._panStart = new THREE.Vector2();
        /**
         * Panning ending vector
         * @private
         * @type {THREE.Vector2}
         */
        this._panEnd = new THREE.Vector2();
        /**
         * Delta adding on each panning
         * @private
         * @type {THREE.Vector2}
         */
        this._panDelta = new THREE.Vector2();
        /**
         * Pan offset
         * @private
         * @type {THREE.Vector3}
         */
        this._panOffset = new THREE.Vector3();
        /**
         * @private
         * @type {THREE.Vector3}
         */
        this._offset = new THREE.Vector3();
        /**
         * @private
         * @type {THREE.Vector2}
         */
        this._dollyStart = new THREE.Vector2();
        /**
         * @private
         * @type {THREE.Vector2}
         */
        this._dollyEnd = new THREE.Vector2();
        /**
         * @private
         * @type {THREE.Vector2}
         */
        this._dollyDelta = new THREE.Vector2();
        /**
         * @private
         * @type {Number}
         */
        this._phiDelta = 0;
        /**
         * @private
         * @type {Number}
         */
        this._thetaDelta = 0;
        /**
         * @private
         * @type {Number}
         */
        this._scale = 1;
        /**
         * @private
         * @type {THREE.Vector3}
         */
        this._pan = new THREE.Vector3();
        /**
         * @private
         * @type {THREE.Vector3}
         */
        this._lastPosition = new THREE.Vector3();
        /**
         * @private
         * @type {Number}
         */
        this._state = STATE.NONE;

        // events
        /**
         * @private
         * @type {Object}
         */
        this._changeEvent = {
            type: 'change'
        };
        /**
         * @private
         * @type {Object}
         */
        this._startEvent = {
            type: 'start'
        };
        /**
         * @private
         * @type {Object}
         */
        this._endEvent = {
            type: 'end'
        };

        this.domElement.addEventListener('contextmenu', function (event) {
            event.preventDefault();
        }, false);
        this.domElement.addEventListener('mousedown', this.__onMouseDown.bind(this), false);
        this.domElement.addEventListener('mousewheel', this.__onMouseWheel.bind(this), false);
        this.domElement.addEventListener('DOMMouseScroll', this.__onMouseWheel.bind(this), false); // firefox

        this.domElement.addEventListener('touchstart', this.__touchstart.bind(this), false);
        this.domElement.addEventListener('touchend', this.__touchend.bind(this), false);
        this.domElement.addEventListener('touchmove', this.__touchmove.bind(this), false);

        window.addEventListener('keydown', this.__onKeyDown.bind(this), false);
    }

    /**
     * @public
     * @param {Number} angle - angle of rotation in radian
     */
    rotateLeft(angle) {
        if (angle === undefined) {
            angle = this.__getAutoRotationAngle();
        }
        this._thetaDelta -= angle;
    };

    /**
     * @public
     * @param {Number} angle - angle of rotation in radian
     */
    rotateUp(angle) {
        if (angle === undefined) {
            angle = this.__getAutoRotationAngle();
        }
        this._phiDelta -= angle;
    };

    /**
     * Pass in distance in world space to move left
     * @public
     * @param {Number} distance - distance in world space to move left
     */
    panLeft(distance) {
        let te = this.object.matrix.elements;
        // get X column of matrix
        this._panOffset.set(te[0], te[1], te[2]);
        this._panOffset.multiplyScalar(-distance);
        this._pan.add(this._panOffset);

    };

    /**
     * Pass in distance in world space to move up
     * @public
     * @param {Number} distance - distance in world space to move up
     */
    panUp(distance) {
        let te = this.object.matrix.elements;
        // get Y column of matrix
        this._panOffset.set(te[4], te[5], te[6]);
        this._panOffset.multiplyScalar(distance);
        this._pan.add(this._panOffset);
    };

    /**
     * Pass in x,y of change desired in pixel space,
     * right and down are positive
     * @public
     * @param {Number} deltaX - distance in world space to move up
     * @param {Number} deltaY - distance in world space to move up
     */
    pan(deltaX, deltaY) {
        let element = this.domElement === document ? this.domElement.body : this.domElement;
        if (this.object.fov !== undefined) {
            // perspective
            let position = this.object.position;
            let offset = position.clone().sub(this.target);
            let targetDistance = offset.length();
            // half of the fov is center to top of screen
            targetDistance *= Math.tan((this.object.fov / 2) * Math.PI / 180.0);
            // we actually don't use screenWidth, since perspective camera is fixed to screen height
            this.panLeft(2 * deltaX * targetDistance / element.clientHeight);
            this.panUp(2 * deltaY * targetDistance / element.clientHeight);
        } else if (this.object.top !== undefined) {
            // orthographic
            this.panLeft(deltaX * (this.object.right - this.object.left) / element.clientWidth);
            this.panUp(deltaY * (this.object.top - this.object.bottom) / element.clientHeight);
        } else {
            // camera neither orthographic or perspective
            console.warn('WARNING: OrbitControls.js encountered an unknown camera type - pan disabled.');
        }
    };

    /**
     * @public
     * @param {Number} dollyScale - zoom scale
     */
    dollyIn(dollyScale) {
        if (dollyScale === undefined) {
            dollyScale = this.__getZoomScale();
        }
        this._scale /= dollyScale;
    };

    /**
     * @public
     * @param {Number} dollyScale - zoom scale
     */
    dollyOut(dollyScale) {
        if (dollyScale === undefined) {
            dollyScale = this.__getZoomScale();
        }
        this._scale *= dollyScale;
    };

    /**
     * @public
     */
    update() {

        if (this.object.top !== undefined) {
            this.object.top = (this._scale * this.object.top);
            this.object.bottom = (this._scale * this.object.bottom);
            this.object.left = (this._scale * this.object.left);
            this.object.right = (this._scale * this.object.right);
            this.object.updateProjectionMatrix();
        }
        let position = this.object.position;
        this._offset.copy(position).sub(this.target);
        this.target.add(this._pan);

        //ToDo: May be Unused code
        position.copy(this.target).add(this._offset);

        this.object.lookAt(this.target);
        this.dispatchEvent(this._changeEvent);
        this._scale = 1;
        this._pan.set(0, 0, 0);
    };

    /**
     * @public
     */
    reset() {
        this._state = STATE.NONE;
        this.target.copy(this.target0);
        this.object.position.copy(this.position0);
        this.update();
    };

    /**
     * @public
     */
    resetPan() {
        this._scale = 1;
    };

    /**
     * @private
     * @return {Number}
     */
    __getAutoRotationAngle() {
        return 2 * Math.PI / 60 / 60 * this.autoRotateSpeed;
    }
    /**
     * @private
     * @return {Number}
     */
    __getZoomScale() {
        return Math.pow(0.95, this.config.zoomSpeed);
    }

    /**
     * @private
     */
    __onMouseDown(event) {

        if (this.config.enabled === false)
            return;

        event.preventDefault();

        if (event.button === 0) {
            if (this.config.noRotate === true)
                return;

            this._state = STATE.ROTATE;
            this._rotateStart.set(event.clientX, event.clientY);

        } else if (event.button === 1) {
            if (this.config.noZoom === true)
                return;

            this._state = STATE.DOLLY;
            this._dollyStart.set(event.clientX, event.clientY);

        } else if (event.button === 2) {
            if (this.config.noPan === true)
                return;

            this._state = STATE.PAN;
            this._panStart.set(event.clientX, event.clientY);

        }

        this.domElement.addEventListener('mousemove', this.__onMouseMove.bind(this), false);
        this.domElement.addEventListener('mouseup', this.__onMouseUp.bind(this), false);
        this.dispatchEvent(this._startEvent);

    }

    /**
     * @private
     */
    __onMouseMove(event) {

        if (this.config.enabled === false)
            return;

        event.preventDefault();

        var element = this.domElement === document ? this.domElement.body : this.domElement;

        if (this._state === STATE.ROTATE) {

            if (this.config.noRotate === true) return;

            this._rotateEnd.set(event.clientX, event.clientY);
            this._rotateDelta.subVectors(this._rotateEnd, this._rotateStart);

            // rotating across whole screen goes 360 degrees around
            this.rotateLeft(2 * Math.PI * this._rotateDelta.x / element.clientWidth * this.config.rotateSpeed);

            // rotating up and down along whole screen attempts to go 360, but limited to 180
            this.rotateUp(2 * Math.PI * this._rotateDelta.y / element.clientHeight * this.config.rotateSpeed);

            this._rotateStart.copy(this._rotateEnd);

        } else if (this._state === STATE.DOLLY) {

            if (this.config.noZoom === true)
                return;

            this._dollyEnd.set(event.clientX, event.clientY);
            this._dollyDelta.subVectors(dollyEnd, dollyStart);

            if (this._dollyDelta.y > 0) {
                this.dollyIn();
            } else {
                this.dollyOut();
            }

            this._dollyStart.copy(this._dollyEnd);

        } else if (this._state === STATE.PAN) {

            if (this.config.noPan === true) return;

            this._panEnd.set(event.clientX, event.clientY);
            this._panDelta.subVectors(this._panEnd, this._panStart);

            this.pan(this._panDelta.x, this._panDelta.y);

            this._panStart.copy(this._panEnd);

        }

        this.update();

    }
    /**
     * @private
     */
    __onMouseUp(event) {

        if (this.config.enabled === false)
            return;

        this.domElement.removeEventListener('mousemove', this.__onMouseMove.bind(this), false);
        this.domElement.removeEventListener('mouseup', this.__onMouseUp.bind(this), false);
        this.dispatchEvent(this._endEvent);
        this._state = STATE.NONE;

    }
    /**
     * @private
     */
    __onMouseWheel(event) {

        if (this.config.enabled === false || this.config.noZoom === true)
            return;

        event.preventDefault();

        var delta = 0;

        if (event.wheelDelta !== undefined) { // WebKit / Opera / Explorer 9

            delta = event.wheelDelta;

        } else if (event.detail !== undefined) { // Firefox

            delta = -event.detail;

        }

        if (delta > 0) {

            this.dollyOut();

        } else {

            this.dollyIn();

        }

        this.update();
        this.dispatchEvent(this._startEvent);
        this.dispatchEvent(this._endEvent);

    }
    /**
     * @private
     */
    __onKeyDown(event) {

        if (this.config.enabled === false || this.config.noKeys === true || this.config.noPan === true)
            return;

        switch (event.keyCode) {

            case this.config.keys.UP:
                this.pan(0, this.config.keyPanSpeed);
                this.update();
                break;

            case this.config.keys.BOTTOM:
                this.pan(0, -this.config.keyPanSpeed);
                this.update();
                break;

            case this.config.keys.LEFT:
                this.pan(this.config.keyPanSpeed, 0);
                this.update();
                break;

            case this.config.keys.RIGHT:
                this.pan(-this.config.keyPanSpeed, 0);
                this.update();
                break;

        }

    }
    /**
     * @private
     */
    __touchstart(event) {

        if (this.config.enabled === false) return;

        switch (event.touches.length) {

            case 1: // one-fingered touch: rotate

                if (this.config.noRotate === true) return;

                this._state = STATE.TOUCH_ROTATE;

                this._rotateStart.set(event.touches[0].pageX, event.touches[0].pageY);
                break;

            case 2: // two-fingered touch: dolly

                if (this.config.noZoom === true) return;

                this._state = STATE.TOUCH_DOLLY;

                let dx = event.touches[0].pageX - event.touches[1].pageX;
                let dy = event.touches[0].pageY - event.touches[1].pageY;
                let distance = Math.sqrt(dx * dx + dy * dy);
                this._dollyStart.set(0, distance);
                break;

            case 3: // three-fingered touch: pan

                if (this.config.noPan === true) return;

                this._state = STATE.TOUCH_PAN;

                this._panStart.set(event.touches[0].pageX, event.touches[0].pageY);
                break;

            default:

                this._state = STATE.NONE;

        }

        this.dispatchEvent(startEvent);

    }
    /**
     * @private
     */
    __touchmove(event) {

        if (this.config.enabled === false) return;

        event.preventDefault();
        event.stopPropagation();

        var element = this.domElement === document ? this.domElement.body : this.domElement;

        switch (event.touches.length) {

            case 1: // one-fingered touch: rotate

                if (this.config.noRotate === true) return;
                if (this._state !== STATE.TOUCH_ROTATE) return;

                this._rotateEnd.set(event.touches[0].pageX, event.touches[0].pageY);
                this._rotateDelta.subVectors(this._rotateEnd, this._rotateStart);

                // rotating across whole screen goes 360 degrees around
                this.rotateLeft(2 * Math.PI * this._rotateDelta.x / element.clientWidth * this.config.rotateSpeed);
                // rotating up and down along whole screen attempts to go 360, but limited to 180
                this.rotateUp(2 * Math.PI * this._rotateDelta.y / element.clientHeight * this.config.rotateSpeed);

                this._rotateStart.copy(this._rotateEnd);

                this.update();
                break;

            case 2: // two-fingered touch: dolly

                if (this.config.noZoom === true) return;
                if (this._state !== STATE.TOUCH_DOLLY) return;

                let dx = event.touches[0].pageX - event.touches[1].pageX;
                let dy = event.touches[0].pageY - event.touches[1].pageY;
                let distance = Math.sqrt(dx * dx + dy * dy);

                this._dollyEnd.set(0, distance);
                this._dollyDelta.subVectors(this._dollyEnd, this._dollyStart);

                if (this._dollyDelta.y > 0) {

                    this.dollyOut();

                } else {

                    this.dollyIn();

                }

                this._dollyStart.copy(dollyEnd);

                this.update();
                break;

            case 3: // three-fingered touch: pan

                if (this.config.noPan === true) return;
                if (this._state !== STATE.TOUCH_PAN) return;

                this._panEnd.set(event.touches[0].pageX, event.touches[0].pageY);
                this._panDelta.subVectors(this._panEnd, this._panStart);

                this.pan(this._panDelta.x, this._panDelta.y);

                this._panStart.copy(this._panEnd);

                this.update();
                break;

            default:

                this._state = STATE.NONE;

        }

    }
    /**
     * @private
     */
    __touchend( /* event */) {

        if (this.config.enabled === false) return;

        this.dispatchEvent(this._endEvent);
        this._state = STATE.NONE;

    }
}

let STATE = {
    NONE: -1,
    ROTATE: 0,
    DOLLY: 1,
    PAN: 2,
    TOUCH_ROTATE: 3,
    TOUCH_DOLLY: 4,
    TOUCH_PAN: 5
};

import * as THREE from 'three';
import Vectorizer from './Vectorizer';

/**
 * Returns the angle in radians of the vector (p1,p2). In other words, imagine
 * putting the base of the vector at coordinates (0,0) and finding the angle
 * from vector (1,0) to (p1,p2).
 * @param  {Object} p1 start point of the vector
 * @param  {Object} p2 end point of the vector
 * @return {Number} the angle
 */
THREE.Math.angle2 = function (p1, p2) {
    let v1 = new THREE.Vector2(p1.x, p1.y);
    let v2 = new THREE.Vector2(p2.x, p2.y);
    v2.sub(v1); // sets v2 to be our chord
    v2.normalize();
    if (v2.y < 0) return -Math.acos(v2.x);
    return Math.acos(v2.x);
};

THREE.Math.polar = function (point, distance, angle) {
    let result = {};
    result.x = point.x + distance * Math.cos(angle);
    result.y = point.y + distance * Math.sin(angle);
    return result;
};

/**
 * Calculates points for a curve between two points
 * @param startPoint - the starting point of the curve
 * @param endPoint - the ending point of the curve
 * @param bulge - a value indicating how much to curve
 * @param segments - number of segments between the two given points
 */
THREE.BulgeGeometry = function (startPoint, endPoint, bulge, segments) {

    let vertex, i, center, p0, p1, angle, radius, startAngle, thetaAngle;

    THREE.Geometry.call(this);

    this.startPoint = p0 = startPoint ? new THREE.Vector2(startPoint.x, startPoint.y) : new THREE.Vector2(0, 0);
    this.endPoint = p1 = endPoint ? new THREE.Vector2(endPoint.x, endPoint.y) : new THREE.Vector2(1, 0);
    this.bulge = bulge = bulge || 1;

    angle = 4 * Math.atan(bulge);
    radius = p0.distanceTo(p1) / 2 / Math.sin(angle / 2);
    center = THREE.Math.polar(startPoint, radius, THREE.Math.angle2(p0, p1) + (Math.PI / 2 - angle / 2));

    this.segments = segments = segments || Math.max(Math.abs(Math.ceil(angle / (Math.PI / 18))), 6); // By default want a segment roughly every 10 degrees
    startAngle = THREE.Math.angle2(center, p0);
    thetaAngle = angle / segments;

    this.vertices.push(new THREE.Vector3(p0.x, p0.y, 0));

    for (i = 1; i <= segments - 1; i++) {

        vertex = THREE.Math.polar(center, Math.abs(radius), startAngle + thetaAngle * i);

        this.vertices.push(new THREE.Vector3(vertex.x, vertex.y, 0));
    }
};

THREE.BulgeGeometry.prototype = Object.create(THREE.Geometry.prototype);

/**
 * @public
 * @extends {Vectorizer}
 * @example 
 * let dxfVectorizer = new DXFVectorizer()
 */
export default class DXFVectorizer extends Vectorizer {
    /**
     * Creates an instance of DXFVectorizer.
     * @constructor
     * @memberof DXFVectorizer
     */
    constructor() {
        super();
        this.font;
    }

    /**
     * Vectorize to draw
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    drawEntity(entity, dxfDb) {
        let mesh;
        if (entity.type === 'CIRCLE' || entity.type === 'ARC') {
            mesh = this.__drawArc(entity, dxfDb);
        } else if (entity.type === 'LWPOLYLINE' || entity.type === 'LINE' || entity.type === 'POLYLINE') {
            mesh = this.__drawLine(entity, dxfDb);
        } else if (entity.type === 'TEXT') {
            mesh = this.__drawText(entity, dxfDb);
        } else if (entity.type === 'SOLID') {
            mesh = this.__drawSolid(entity, dxfDb);
        } else if (entity.type === 'POINT') {
            mesh = this.__drawPoint(entity, dxfDb);
        } else if (entity.type === 'INSERT') {
            mesh = this.__drawBlock(entity, dxfDb);
        } else if (entity.type === 'SPLINE') {
            mesh = this.__drawSpline(entity, dxfDb);
        } else if (entity.type === 'MTEXT') {
            mesh = this.__drawMtext(entity, dxfDb);
        } else if (entity.type === 'ELLIPSE') {
            mesh = this.__drawEllipse(entity, dxfDb);
        } else {
            console.log("Unsupported Entity Type: " + entity.type);
        }
        return mesh;
    }
    /**
     * Vectorize Ellipse
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawEllipse(entity, dxfDb) {
        let color = this.__getColor(entity, dxfDb);

        let xrad = Math.sqrt(Math.pow(entity.majorAxisEndPoint.x, 2) + Math.pow(entity.majorAxisEndPoint.y, 2));
        let yrad = xrad * entity.axisRatio;
        let rotation = Math.atan2(entity.majorAxisEndPoint.y, entity.majorAxisEndPoint.x);

        let curve = new THREE.EllipseCurve(entity.center.x, entity.center.y, xrad, yrad, entity.startAngle, entity.endAngle, false, // Always counterclockwise
            rotation);

        let points = curve.getPoints(50);
        let geometry = new THREE.BufferGeometry().setFromPoints(points);
        let material = new THREE.LineBasicMaterial({
            linewidth: 1,
            color: color
        });

        // Create the final object to add to the scene
        return new THREE.Line(geometry, material);
    }
    /**
     * Vectorize Line
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawLine(entity, dxfDb) {
        let geometry = new THREE.Geometry(),
            color = this.__getColor(entity, dxfDb),
            material,
            lineType;

        // create geometry
        for (let i = 0; i < entity.vertices.length; i++) {

            if (entity.vertices[i].bulge) {
                let bulge = entity.vertices[i].bulge;
                let startPoint = entity.vertices[i];
                let endPoint = i + 1 < entity.vertices.length ? entity.vertices[i + 1] : geometry.vertices[0];

                let bulgeGeometry = new THREE.BulgeGeometry(startPoint, endPoint, bulge);

                geometry.vertices.push.apply(geometry.vertices, bulgeGeometry.vertices);
            } else {
                let vertex = entity.vertices[i];
                geometry.vertices.push(new THREE.Vector3(vertex.x, vertex.y, 0));
            }
        }
        if (entity.shape) geometry.vertices.push(geometry.vertices[0]);

        // set material
        if (entity.lineType) {
            lineType = dxfDb.tables.LTYPE.LTYPE[entity.lineType];
        }

        if (lineType && lineType.pattern && lineType.pattern.length !== 0) {
            material = new THREE.LineDashedMaterial({
                color: color,
                gapSize: 4,
                dashSize: 4
            });
        } else {
            material = new THREE.LineBasicMaterial({
                linewidth: 1,
                color: color
            });
        }

        // if(lineType && lineType.pattern && lineType.pattern.length !== 0) {

        //           geometry.computeLineDistances();

        //           // Ugly hack to add diffuse to this. Maybe copy the uniforms object so we
        //           // don't add diffuse to a material.
        //           lineType.material.uniforms.diffuse = { type: 'c', value: new THREE.Color(color) };

        // 	material = new THREE.ShaderMaterial({
        // 		uniforms: lineType.material.uniforms,
        // 		vertexShader: lineType.material.vertexShader,
        // 		fragmentShader: lineType.material.fragmentShader
        // 	});
        // }else {
        // 	material = new THREE.LineBasicMaterial({ linewidth: 1, color: color });
        // }
        return new THREE.Line(geometry, material);
    }


    /**
     * Vectorize Mtext
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawMtext(entity, dxfDb) {

        if (!this.font) return console.warn('MText is not supported without a Three.js font loaded with THREE.FontLoader! Load a font of your choice and pass this into the constructor. See the sample for this repository or Three.js examples at http://threejs.org/examples/?q=text#webgl_geometry_text for more details.');

        let color = this.__getColor(entity, dxfDb);

        let geometry = new THREE.TextGeometry(entity.text, {
            font: this.font,
            size: entity.height * (4 / 5),
            height: 1
        });
        let material = new THREE.MeshBasicMaterial({
            color: color
        });
        let text = new THREE.Mesh(geometry, material);

        // Measure what we rendered.
        let measure = new THREE.Box3();
        measure.setFromObject(text);

        let textWidth = measure.max.x - measure.min.x;

        // If the text ends up being wider than the box, it's supposed
        // to be multiline. Doing that in threeJS is overkill.
        if (entity.width != 0 && textWidth > entity.width) {
            console.log("Can't render this multipline MTEXT entity, sorry.", entity);
            return undefined;
        }

        text.position.z = 0;
        switch (entity.attachmentPoint) {
            case 1:
                // Top Left
                text.position.x = entity.position.x;
                text.position.y = entity.position.y - entity.height;
                break;
            case 2:
                // Top Center
                text.position.x = entity.position.x - textWidth / 2;
                text.position.y = entity.position.y - entity.height;
                break;
            case 3:
                // Top Right
                text.position.x = entity.position.x - textWidth;
                text.position.y = entity.position.y - entity.height;
                break;

            case 4:
                // Middle Left
                text.position.x = entity.position.x;
                text.position.y = entity.position.y - entity.height / 2;
                break;
            case 5:
                // Middle Center
                text.position.x = entity.position.x - textWidth / 2;
                text.position.y = entity.position.y - entity.height / 2;
                break;
            case 6:
                // Middle Right
                text.position.x = entity.position.x - textWidth;
                text.position.y = entity.position.y - entity.height / 2;
                break;

            case 7:
                // Bottom Left
                text.position.x = entity.position.x;
                text.position.y = entity.position.y;
                break;
            case 8:
                // Bottom Center
                text.position.x = entity.position.x - textWidth / 2;
                text.position.y = entity.position.y;
                break;
            case 9:
                // Bottom Right
                text.position.x = entity.position.x - textWidth;
                text.position.y = entity.position.y;
                break;

            default:
                return undefined;
        };
        return text;
    }

    /**
     * Vectorize Spline
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawSpline(entity, dxfDb) {
        let color = this.__getColor(entity, dxfDb);

        let points = entity.controlPoints.map(function (vec) {
            return new THREE.Vector2(vec.x, vec.y);
        });

        let interpolatedPoints = [];
        let curve = null;
        if (entity.degreeOfSplineCurve === 2 || entity.degreeOfSplineCurve === 3) {
            for (let i = 0; i + 2 < points.length; i = i + 2) {
                if (entity.degreeOfSplineCurve === 2) {
                    curve = new THREE.QuadraticBezierCurve(points[i], points[i + 1], points[i + 2]);
                } else {
                    curve = new THREE.QuadraticBezierCurve3(points[i], points[i + 1], points[i + 2]);
                }
                interpolatedPoints.push.apply(interpolatedPoints, curve.getPoints(50));
            }
        } else {
            curve = new THREE.SplineCurve(points);
            interpolatedPoints = curve.getPoints(100);
        }

        let geometry = new THREE.BufferGeometry().setFromPoints(interpolatedPoints);
        let material = new THREE.LineBasicMaterial({
            linewidth: 1,
            color: color
        });
        let splineObject = new THREE.Line(geometry, material);

        return splineObject;
    }

    /**
     * Vectorize Arc/Circle
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawArc(entity, dxfDb) {
        let startAngle = 0,
            endAngle = 0;
        if (entity.type === 'CIRCLE') {
            startAngle = entity.startAngle || 0;
            endAngle = startAngle + 2 * Math.PI;
        } else {
            startAngle = entity.startAngle;
            endAngle = entity.endAngle;
        }

        let curve = new THREE.ArcCurve(0, 0, entity.radius, startAngle, endAngle);

        let points = curve.getPoints(32);
        let geometry = new THREE.BufferGeometry().setFromPoints(points);

        let material = new THREE.LineBasicMaterial({
            color: this.__getColor(entity, dxfDb)
        });

        let arc = new THREE.Line(geometry, material);
        arc.position.x = entity.center.x;
        arc.position.y = entity.center.y;
        arc.position.z = entity.center.z;

        return arc;
    }

    /**
     * Vectorize Solid
     * @private
     * @param {Object} entity - entity object
     * @param {Object} dxfDb - dxf Database object
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawSolid(entity, dxfDb) {
        let material,
            verts,
            geometry = new THREE.Geometry();

        verts = geometry.vertices;
        verts.push(new THREE.Vector3(entity.points[0].x, entity.points[0].y, entity.points[0].z));
        verts.push(new THREE.Vector3(entity.points[1].x, entity.points[1].y, entity.points[1].z));
        verts.push(new THREE.Vector3(entity.points[2].x, entity.points[2].y, entity.points[2].z));
        verts.push(new THREE.Vector3(entity.points[3].x, entity.points[3].y, entity.points[3].z));

        // Calculate which direction the points are facing (clockwise or counter-clockwise)
        let vector1 = new THREE.Vector3();
        let vector2 = new THREE.Vector3();
        vector1.subVectors(verts[1], verts[0]);
        vector2.subVectors(verts[2], verts[0]);
        vector1.cross(vector2);

        // If z < 0 then we must draw these in reverse order
        if (vector1.z < 0) {
            geometry.faces.push(new THREE.Face3(2, 1, 0));
            geometry.faces.push(new THREE.Face3(2, 3, 1));
        } else {
            geometry.faces.push(new THREE.Face3(0, 1, 2));
            geometry.faces.push(new THREE.Face3(1, 3, 2));
        }

        material = new THREE.MeshBasicMaterial({
            color: this.__getColor(entity, dxfDb)
        });

        return new THREE.Mesh(geometry, material);
    }

    /**
     * Vectorize Text
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawText(entity, dxfDb) {
        let geometry,
            material,
            text;

        if (!this.font) return console.warn('Text is not supported without a Three.js font loaded with THREE.FontLoader! Load a font of your choice and pass this into the constructor. See the sample for this repository or Three.js examples at http://threejs.org/examples/?q=text#webgl_geometry_text for more details.');

        geometry = new THREE.TextGeometry(entity.text, {
            font: this.font,
            height: 0,
            size: entity.textHeight || 12
        });

        material = new THREE.MeshBasicMaterial({
            color: this.__getColor(entity, dxfDb)
        });

        text = new THREE.Mesh(geometry, material);
        text.position.x = entity.startPoint.x;
        text.position.y = entity.startPoint.y;
        text.position.z = entity.startPoint.z;

        return text;
    }

    /**
     * Vectorize Point
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawPoint(entity, dxfDb) {
        let geometry, material, point;

        geometry = new THREE.Geometry();

        geometry.vertices.push(new THREE.Vector3(entity.position.x, entity.position.y, entity.position.z));

        // TODO: could be more efficient. PointCloud per layer?

        let numPoints = 1;

        let color = this.__getColor(entity, dxfDb);
        let colors = new Float32Array(numPoints * 3);
        colors[0] = color.r;
        colors[1] = color.g;
        colors[2] = color.b;

        geometry.colors = colors;
        geometry.computeBoundingBox();

        material = new THREE.PointsMaterial({
            size: 0.05,
            vertexColors: THREE.VertexColors
        });

        return new THREE.Points(geometry, material);
    }

    /**
     * Vectorize Block
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __drawBlock(entity, dxfDb) {
        let block = dxfDb.blocks[entity.name];

        if (!block.entities) return null;

        let group = new THREE.Object3D();

        if (entity.xScale) group.scale.x = entity.xScale;
        if (entity.yScale) group.scale.y = entity.yScale;

        if (entity.rotation) {
            group.rotation.z = entity.rotation * Math.PI / 180;
        }

        if (entity.position) {
            group.position.x = entity.position.x;
            group.position.y = entity.position.y;
            group.position.z = entity.position.z;
        }

        for (let i = 0; i < block.entities.length; i++) {
            let childEntity = this.drawEntity(block.entities[i], dxfDb, group);
            if (childEntity) group.add(childEntity);
        }

        return group;
    }

    /**
     * Compute entity Color
     * @private
     * @param {Object} entity - entity dxfDb
     * @param {Object} dxfDb - dxf Database
     * @return {THREE.Mesh}
     * @memberof DXFVectorizer
     */
    __getColor(entity, dxfDb) {
        let color = 0x000000; //default
        if (entity.color) color = entity.color;
        else if (dxfDb.tables && dxfDb.tables.LAYER && dxfDb.tables.LAYER.LAYER[entity.layer])
            color = dxfDb.tables.LAYER.LAYER[entity.layer].color;

        if (color == null || color === 0xffffff) {
            color = 0x000000;
        }
        return color;
    }
}

