                    block.altName = group.value;
                    break;
                case 5:
                    block.handle = group.value;
                    break;
                case 8:
                    block.layer = group.value;
                    break;
                case 10:
                    block.position = this.__parsePoint(scanner);
                    break;
                case 67:
                    block.paperSpace = (group.value && group.value == 1) ? true : false;
                    break;
                case 70:
                    if (group.value != 0) {
