            case 'CIRCLE':
                scanner.rewind();
                entity = CIRCLE.parse(scanner);
                break;
            case 'MTEXT':
                scanner.rewind();
                entity = MTEXT.parse(scanner);
                break;
            case 'POINT':
                scanner.rewind();
                entity = POINT.parse(scanner);
                break;
            case 'VERTEX':
                scanner.rewind();
                entity = VERTEX.parse(scanner);
                break;
            case 'SPLINE':
                scanner.rewind();
                entity = SPLINE.parse(scanner);
                break;
            case 'TEXT':
                scanner.rewind();
                entity = TEXT.parse(scanner);
                break;
            case 'ELLIPSE':
                scanner.rewind();
                entity = ELLIPSE.parse(scanner);
                break;
            case 'INSERT':
                scanner.rewind();
                entity = INSERT.parse(scanner);
                break;
            case 'SOLID':
                scanner.rewind();
                entity = SOLID.parse(scanner);
                break;
            case 'ATTDEF':
