                entity = ATTDEF.parse(scanner);
                break;
            case 'DIMENSION':
                scanner.rewind();
                entity = DIMENSION.parse(scanner);
                break;
            case 'LWPOLYLINE':
                scanner.rewind();
                entity = LWPOLYLINE.parse(scanner);
