                    entity.knotValues.push(group.value);
                    break;
                case 70:
                    if ((group.value & 1) != 0) entity.closed = true;
                    if ((group.value & 2) != 0) entity.periodic = true;
                    if ((group.value & 4) != 0) entity.rational = true;
                    if ((group.value & 8) != 0) entity.planar = true;
                    if ((group.value & 16) != 0) {
                        entity.planar = true;
                        entity.linear = true;
